//Sidebar imports
import {
    UilEstate,
    UilClipboardAlt,
    UilUsersAlt,
    UilPackage,
    UilChart,
    UilSignOutAlt,
} from "@iconscout/react-unicons";


//Sidebar Data
export const SidebarData = [
    {
        icon: UilEstate,
        heading: "Dashboard",
    },
    {
        icon: UilUsersAlt,
        heading: "All Classes",
    },
    {
        icon: UilClipboardAlt,
        heading: "Assignments",
    },
    {
        icon: UilChart,
        heading: "Privacy Policy",
    },
    {
        icon: UilPackage,
        heading: "About Us",
    },
]

export const CardsData = [
    {
        title: "Integer",
        color: {
            backGround: "linear-gradient(180deg, $bb67ff 0%, #c484f3 100)"
        },
    },
]
